column1:
The whole reason why Bumble makes Women be the ones to write first is because this is the list of 99% of messages they'll get, if men can make a move first:
- Just "hi", "hello" or "how you doing" (add smiley faces to taste;
- Bunch of text that is clearly copy/pasted to every girl with just the name changed to suit the recepient (often gets sent with the wrong name still on it);
- "finna fuck?" or some variant of this;
- "what's your sign?" (Some guys think women love to talk about star signs);
Then there's Patrice O'Neal, who writes something along the lines of "Hey bitch, you look like your breasts stink" and miraculously gets laid with that line.
